import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 32, height: 32, viewBox: "0 0 32 32", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M2 16a14 14 0 1028 0 14 14 0 00-28 0zm13.3 6.7a1 1 0 010-1.4l4.29-4.3H10a1 1 0 110-2h9.59l-4.3-4.3a1 1 0 011.42-1.4l6 6a1 1 0 010 1.4l-6 6a1 1 0 01-1.42 0z", fill: primaryFill }));
};
const ArrowCircleRight32Filled = wrapIcon(rawSvg({}), 'ArrowCircleRight32Filled');
export default ArrowCircleRight32Filled;
